tables.table_schema:
CREATE TABLE vehicle_metrics (
  vehicle_id INT PRIMARY KEY,
  engine_temperature FLOAT,
  oil_pressure FLOAT,
  fuel_level FLOAT
);

CREATE TABLE maintenance_logs (
  log_id INT PRIMARY KEY,
  vehicle_id INT,
  maintenance_type VARCHAR(255),
  maintenance_description TEXT
);

CREATE TABLE vehicle_metrics (
    vehicle_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    engine_temperature FLOAT,
    fuel_level FLOAT
);

CREATE TABLE error_logs (
    log_id INT PRIMARY KEY,
    vehicle_id INT,
    timestamp TIMESTAMP,
    error_message TEXT
);

CREATE TABLE operational_efficiency (
    efficiency_id INT PRIMARY KEY,
    vehicle_id INT,
    efficiency_score FLOAT,
    efficiency_date DATE
);

CREATE TABLE maintenance_needs (
    need_id INT PRIMARY KEY,
    vehicle_id INT,
    maintenance_type VARCHAR(50),
    priority_level INT
);

CREATE TABLE vehicle_health_status (
    health_id INT PRIMARY KEY,
    vehicle_id INT,
    health_status VARCHAR(20),
    last_checkup_date DATE
);
